const Upload = () => {
  // usestate for setting a javascript
  // object for storing and using data
  const [file, setFile] = useState(null);
  //   const [model, setModel] = useState(null);
  const [processing, setProcessing] = useState(false);
  const [topkPredNames, setPrediction] = useState(null);
  const [imageLoaded, setImageLoaded] = useState(false);
  const [allpokemon,setAllpoke]=useState([]);

  const [model, setModel] = useState(null);
  function readImage(file) {
    // try{
      return new Promise((rs, rj) => {
        const fileReader = new FileReader();
        fileReader.onload = () => rs(fileReader.result);
        fileReader.onerror = () => rj(fileReader.error);
        if(!file){
          window.location.reload(false);
        }
        fileReader.readAsDataURL(file);
      });
    
   
  }
  function createpoke (result){
    console.log("here");
    console.log(result)
    console.log("here1");
    result.forEach( async(pokemon) => {
      console.log(pokemon);
      const res=await fetch(`https://pokeapi.co/api/v2/pokemon/${pokemon}`)     
      const data =await res.json()
      console.log("lol")
      console.log(data);
      // allpokemon.push(data)
      setAllpoke(currentList=>[...currentList,data])
      
      // allpokemon.sort((a, b) => a.id - b.id)
      console.log("lolol")
      console.log(allpokemon);
    });
  }
  async function handleImgUpload(event) {
    setAllpoke([]);
    setProcessing(true);
    const {
      target: { files },
    } = event;

    const _file = files[0];
    const fileData = await readImage(_file);
    setFile(fileData);

  }

  const MODEL_HTTP_URL = "api/pokeml/classify";
  const MODEL_INDEXEDDB_URL = "indexeddb://poke-model";

  const getTopKPred = (pred, k) => {
    const predIdx = [];
    const predNames = [];

    const topkPred = [...pred].sort((a, b) => b - a).slice(0, k);
    // console.log("hh");
    console.log(topkPred);
    topkPred.map((i) => predIdx.push(pred.indexOf(i)));
    console.log("k");
    console.log(predIdx)
    // console.log(idx2class1)
    predIdx.map((i) => predNames.push(idx2class1[i]));
    // console.log(predNames);
    return predNames;
  };

  const getTopKPredPokeObj = (pred, k) => {
    const predPokeName = getTopKPred(pred, k);
    console.log(predPokeName);

    return predPokeName;
  };
  useEffect(() => {
    async function fetchModel() {
      try {
        const localClassifierModel = await tf.loadLayersModel(
          MODEL_INDEXEDDB_URL
        );

        setModel(localClassifierModel);
        console.log("Model loaded from IndexedDB");
      } catch (e) {
        try {
          const classifierModel = await tf.loadLayersModel(MODEL_HTTP_URL);

          console.log(classifierModel);
          setModel(classifierModel);
          console.log("Model Loaded");
          await classifierModel.save(MODEL_INDEXEDDB_URL);
          console.log("Model saved to IndexedDB");
        } catch (e) {
          console.log("Unable to load model at all: ", e);
        }
      }
    }
    fetchModel();
  }, []);
  useEffect(() => {
    async function predict() {
      if (imageLoaded && file) {
        const imageElement = document.createElement("img");
        imageElement.src = file;

        imageElement.onload = async () => {
          const tensor = tf.browser
            .fromPixels(imageElement)
            .resizeNearestNeighbor([120, 120])
            .toFloat()
            .sub(127)
            .div(127)
            .expandDims();

          const y_pred = await model.predict(tensor).data();
            // console.log(y_pred);
          // console.log(pokemonState);

          const topkPredNames = getTopKPredPokeObj(y_pred, 3);

          //   dispatch(setePredictions({ predictions: topkPredNames }));
          setPrediction(topkPredNames);
          await createpoke(topkPredNames);
          console.log(topkPredNames);
          // console.log("hh")
          console.log("-----------");
          //   console.log(prediction);
          setProcessing(false);
          setImageLoaded(false);
          return topkPredNames;
          //   setPrediction(parseInt(prediction, 10));
        };
      }
    }

    predict();
  }, [imageLoaded, model, file]);

  return (
    <div className="loginContainer">
      <form className="Form">
        <label htmlFor="upload-image">Upload image</label>
        <br/>
        <input id="image-selector"
          type="file"
          name="upload-image"
          accept="image/*"
          onChange={handleImgUpload}
          disabled={!model || processing}/>
      </form>
      <div>
        <img
          onLoad={() => {
            setImageLoaded(true);
          }}
          alt=""
          src={file}
        />
      </div>
      <div>
        {processing ? (
          <h1>Loading ...</h1>
        ) : topkPredNames !== null ? (
          <div>
            {allpokemon && allpokemon.map( (pokemonStats, index) => 
              <div>
                <Thumb
                key={index}
                id={pokemonStats.id}
                image={pokemonStats.sprites.other.dream_world.front_default}
                name={pokemonStats.name}
                type={pokemonStats.types[0].type.name}
                base_experience={pokemonStats.base_experience}
              />
              </div>
            )}
          </div>
        ) : null}
      </div>
    </div>
  );
};

